import{_ as e,o as t,c as i,a}from"./app.6802c6f2.js";var n="/aktivitaeten/BDM-2025-04/00_04-2025.jpg",r="/aktivitaeten/BDM-2025-04/01_04-2025.jpg",s="/aktivitaeten/BDM-2025-04/02_04-2025.jpg",d="/aktivitaeten/BDM-2025-04/03_04-2025.jpg",p="/aktivitaeten/BDM-2025-04/04_04-2025.jpg",l="/aktivitaeten/BDM-2025-04/05_04-2025.jpg",m="/aktivitaeten/BDM-2025-04/06_04-2025.jpg",o="/aktivitaeten/BDM-2025-04/07_04-2025.jpg",u="/aktivitaeten/BDM-2025-04/08_04-2025.jpg",g="/aktivitaeten/BDM-2025-04/09_04-2025.jpg",_="/aktivitaeten/BDM-2025-04/11_04-2025.jpg",c="/aktivitaeten/BDM-2025-04/12_04-2025.jpg",h="/aktivitaeten/BDM-2025-04/13_04-2025.jpg",k="/aktivitaeten/BDM-2025-04/14_04-2025.jpg",B="/aktivitaeten/BDM-2025-04/15_04-2025.jpg",v="/aktivitaeten/BDM-2025-04/16_04-2025.jpg",D="/aktivitaeten/BDM-2025-04/17_04-2025.jpg",M="/aktivitaeten/BDM-2025-04/18_04-2025.jpg",b="/aktivitaeten/BDM-2025-04/19_04-2025.jpg",w="/aktivitaeten/BDM-2025-04/20_04-2025.jpg",S="/aktivitaeten/BDM-2025-04/21_04-2025.jpg",z="/aktivitaeten/BDM-2025-04/22_04-2025.jpg",f="/aktivitaeten/BDM-2025-04/23_04-2025.jpg",j="/aktivitaeten/BDM-2025-04/24_04-2025.jpg",A="/aktivitaeten/BDM-2025-04/25_04-2025.jpg",L="/aktivitaeten/BDM-2025-04/26_04-2025.jpg",P="/aktivitaeten/BDM-2025-04/27_04-2025.jpg",O="/aktivitaeten/BDM-2025-04/28_04-2025.jpg",E="/aktivitaeten/BDM-2025-04/29_04-2025.jpg",F="/aktivitaeten/BDM-2025-04/30_04-2025.jpg",T="/aktivitaeten/BDM-2025-04/31_04-2025.jpg";const N={},Q=a('<h1 id="bilder-des-monats-april-2025" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-april-2025" aria-hidden="true">#</a> Bilder des Monats April 2025</h1><p>Die Bedingungen waren heute nicht berauschend, trotzdem wollte ich noch etwas an die frische Luft und so sollte es mal wieder eine Aktivierung von DE-0244 werden, der erste Park den ich in DL aktiviert hatte. Ich hatte leider kaum Internet zum Spotten, am Ende kamen aber doch 13 SSB und 5 CW QSOs ins Log. 73 DF9HC</p><p><img src="'+n+'" alt="Bilder des Monats"><img src="'+r+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"><img src="'+d+'" alt="Bilder des Monats"></p><p>Am 06.04. haben wir den Th\xF6rls Park in Hamburg (DE-0261) mit den beiden Fernwanderwegen E1 (DE-0558) und E9 (DE-0622) aktiviert. Bei m\xE4\xDFigen Bedingungen auf Kurzwelle kamen etwas \xFCber 20 QSOs auf 20m und 40m ins Log. Dazu ein paar 2m-Kontakte und Park2Park-Verbindungen zu anderen Drau\xDFenfunkern.</p><p>Zum Einsatz kam das FT-891 mit dem Mic-Splitter f\xFCr reibungslosen Multi-Op-Betrieb an der 1/4 Wellen Vertikalantenne.</p><p>Tobias (DC1TC) und Harm (DK4HAA).</p><p><img src="'+p+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"></p><p>Text mit dem Bild ....</p><p>Ihr wollt also das man erstmal das Bild hochl\xE4de und dann den Text \xFCber bearbeiten einf\xFCgt.</p><p>Der Text soll \xFCber dem Bild stehen und nicht darunter?</p><p>Bild von DL4DP mit der QRP Ausr\xFCstung am Fahrrad.</p><p><img src="'+m+'" alt="Bilder des Monats"></p><p>DB6NL - Danke der Pota-Map hab ich hinter der Ferienwohnung einen 3-fer entdeckt. So kamen neben der Skiausr\xFCstung auch Antennenmast und FX-4CR in die Jatbag. Die Tallage und die Bandbedingungen haben die Aktivierung leider ziemlich z\xE4h werden lassen, aber mit DL6PL und DO1EDK kamen zumindestens zwei DFs ins Log\u2026</p><p><img src="'+o+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"></p><p>Da ich zur Zeit in Holland Urlaub mache, hatte ich bereits zu Hause einen Plan erstellt, was ich gerne aktivieren m\xF6chte. Daraus entstand ein SOTA Spot mit PA/PA-006, sowie verschiende POTA Spots (NL-0007, NL-0036, NL-0040, NL-0074), die auch gleichzeitig f\xFCr WWFF genutzt werden konnten. Nachdem wir am SOTA Fu\xDFpunkt angekommen waren, mussten wir eine knappe halbe Stunde zum Gipfel gehen. Dort angekommen, direkt das Funkger\xE4t und Antenne aufgebaut und auf 20 und 40m die M\xF6glichkeiten genutzt um insgesamt 32 QSOs ins Log zu bekommen. Danach ging es dann f\xFCr mich alleine weiter, da meine Familie und die Freunde schon genug hatten. Also ab zum 3-Fer mit NL-0007, NL-0074 und NL-0036. Nachdem es wieder eine knappe halbe Stunde brauchte, um genau diese \xDCberlappung der 3 Parks zu erreichen (Dank einer Info eines holl\xE4ndischen OMs), baute ich wieder alles auf und sa\xDF dann zwischen Galloway-Rinder und habe dort meine 53 QSO\xB4s in knapp 45 Minuten gehabt. Die Rinder waren sehr entspannt. Zum Abschlu\xDF des Funktages ging es dann weiter zu meinem letzten POTA-Spot (NL-0040). Dort war es zum Gl\xFCck etwas entspannter. Auto parken, 3 Meter zur Sitzbank und das Ganze dann wieder abgearbeitet mit 36 QSO\xB4s. Bei allen 3 Aktivit\xE4ten kamen auch QSO\xB4s mit Draussenfunkern zustande. 73 de (PD/)DO1EDK</p><p><img src="'+_+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+B+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"></p><p>Habe es am 12.04. noch vor der Brutzeit (Strandbetretungsverbot vom 14.04. bis 16.07.) geschafft, bei der Aktivierung des NSG Geltinger Birk (POTA DE-0741) den Spot am Strand einem Masttauglichkeitstest zu unterziehen: geht mit leichtem Mast einwandfrei. Man muss nur R\xFCcksicht auf Besucher nehmen, die den Aussichtspunkt auch nutzen m\xF6chten und hin und wieder die Aussendungen f\xFCr eine Weile einstellen.</p><p><img src="'+b+'" alt="Bilder des Monats"></p><p>Support your Parks Fr\xFChlingsevent von DE-0796.</p><p><img src="'+w+'" alt="Bilder des Monats"></p><p>Support your Parks von DE-0925</p><p><img src="'+S+'" alt="Bilder des Monats"></p><p>DL7DL SOTA SV/CR-029 &amp; POTA GR-0160 auf 15m, mit 2W des ADX-S, 21 QSOs, davon 10 mit Deutschland.</p><p><img src="'+z+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"><img src="'+j+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"></p><p>Dirk DL4DP QRV in NL-0018 in der Betriebsart PSK31.</p><p>Leider ohne Erfolg in dieser Betriebsart...</p><p><img src="'+L+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"></p><p>DC1TC: Zu Ostern und somit zum Support Your Parks Weekend ging es f\xFCr mich mal wieder nach DE-0107 Holsteinische Schweiz.</p><p><img src="'+F+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"></p>',29),C=[Q];function H(R,x){return t(),i("div",null,C)}var W=e(N,[["render",H],["__file","2025-04-30-Bilder-Des-Monats-April.html.vue"]]);export{W as default};
